import { Card, Button } from 'react-bootstrap';

const RadnyCard = ({ radny }) => {
  return (
    <Card className="mb-4">
      <Card.Img variant="top" src={radny.photo_url} alt={radny.name} />
      <Card.Body>
        <Card.Title>{radny.name}</Card.Title>
        <Card.Text>
          {radny.description}
        </Card.Text>
        <Card.Text>
          {radny.party}
        </Card.Text>
        <Button variant="primary">WiÄ™cej</Button>
      </Card.Body>
    </Card>
  );
};

export default RadnyCard;
